// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Home from './components/home/home';

function App() {
  return (
    <Router>
        <div className="App">
          <Route path="/" component={Home} exact />
        </div>
    </Router>
  );
}

export default App;
